import React, { useState, useEffect } from 'react';
import {Link} from 'react-router-dom';
import { IsAuthenticated } from './Api/Auth.js';

const Navbar = () => {

  //Função que mostra se o usuário está logado 
  const Logged = () => {

    const [IsLogged, setIsLogged] = useState();
    useEffect(()=>{
      setIsLogged(IsAuthenticated());
    });
  
    if (IsLogged){
      return (
        <span>
          Logado!
        </span>
      )
    } else {
      return (
        <span>
          Deslogado!
        </span>
      )
    }
  }

  return(
    <>
      <ul>
        <li>
          <Link to='/'>
            Welcome
          </Link>
          <Link to='Login'>
            Login
          </Link>
          <Link to='signup'>
            SignUp
          </Link>
          <Link to='items'>
            Items
          </Link>
          <Link to='me'>
            Me
          </Link>
          <Link to='cart'>
            Cart
          </Link>
          <Logged />
        </li>
      </ul>
    </>
  )
}

export default Navbar;
